function Main(props) {
  return (
    <main className='main'> 
    <div className='main__container'> 
          <div className='main__heading'>There's some amazing stuff going to be here!!!  </div>  
          <div className='main__subheading'>Find the latest news on any topic and save them in your personal account. </div>  
    </div>
    <section className='cards'>
                    <div className='cards__block'>
                        <h2 className='cards__title'>Search results</h2>
                        <NewsCardList
                            loggedin={props.loggedin}
                            savedNewsLocation={props.savedNewsLocation} />
                        <button className='cards__btn'>Show more</button>
                    </div>
                </section>
    </main>
        )
}

export default Main;
